import PropTypes from "prop-types";

const PostCardContent = ({ content }) => {
  return (
      <>{content.split(/#[^\s#]+/g)}</>
  )
}

PostCardContent.propTypes = {
  content: PropTypes.string.isRequired
}

export default PostCardContent;
